import React from 'react'
import "../style.css";

export default function home({token, name}) {
  return (
    <>
    <div className='main'>
        <div>
            <h3>Welcome</h3>
            <h2>{name}</h2>
            <button>Take Photo</button>
            <button>Current Location</button>
        </div>
    </div>
    </>
  )
}
